import React from "react";

interface City {
  city_name: string;
  temp: string;
  humidity: string;
}

export default function SavedCity(props: City) {
  return (
    <div className="flex ">
      <button onClick={() => console.log(props)}>aaaaa</button>
      <h2>{props.city_name}</h2>
      <h2>{props.temp}</h2>
      <h2>{props.humidity}</h2>
    </div>
  );
}
